import React, { Component } from 'react';
import { Nav, Navbar } from 'react-bootstrap';
import { BrowserRouter, Switch, Route, Link } from 'react-router-dom';
import SlideView from './components/SlideView/index.js';
import styled from 'styled-components';
import Projects from './components/Projects.js';
import Articles from './components/Articles.js';
import About from './components/About.js';
import './App.css';



 const AppWrapper = styled.div`
  display: flex;
  justify-content: center;
`

class App extends Component {
 render() { 

  const sliderSettings = {
    dots: true,
    infinite: true,
    fade: true,
    slidesToShow: 1,
    slidesToScroll: 1
  };
  
  return (

 <div className="App">
      <h1>Hello CodeSandbox</h1>
      <h2>Start editing to see some magic happen!</h2>

      <Slider {...sliderSettings} className="carousel">
        <Link to="/page-1">
          <div>
            <img src="https://via.placeholder.com/350x150" />
            Page 1
          </div>
        </Link>
        <Link to="/page-2">
          <div>
            <img src="https://via.placeholder.com/350x150" />
            Page 2
          </div>
        </Link>
        <Link to="/page-3">
          <div>
            <img src="https://via.placeholder.com/350x150" />
            Page 3
          </div>
        </Link>
      </Slider>
    </div>  
    
 /* <BrowserRouter>
    <div className="App">

        <Navbar expand="lg" bg="dark" sticky="top">
          <Navbar.Brand href="#home">React-Bootstrap Portfolio</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse className="justify-content-end">

            <Nav>
                <Link to="/" className="nav-item">Projects</Link>                         
                <Link to="/articles" className="nav-item">Articles</Link>      
                <Link to="about" className="nav-item">About</Link>
            </Nav>

          </Navbar.Collapse>
        </Navbar>

        <Switch>
          <Route exact path="/" component={Projects} />
          <Route path="/articles" component={Articles} />
          <Route path="/about" component={About} />
        </Switch>

    </div>
  </BrowserRouter> */
   
  );
 }
}

export default App;
